<!DOCTYPE html>
<html>
<head>
    <title>typeof Example</title>
    <script type="text/javascript">

        const myTarget = {};
        const proxy = new Proxy(myTarget, {
            ownKeys(target) {
                console.log('ownKeys()');
                return Reflect.ownKeys(...arguments)
            }
        });
        Object.keys(proxy);
        // ownKeys()

    </script>

</head>

</html>
